日用品(\)オーラルケア(\)歯ブラシ<br>キスユー イオン歯ブラシ フラットスリム ふつう 替えブラシ 2本<br>マイナスイオンで、歯と歯ぐきをけんこうにする「キスユー」シリーズの取り替え用ブラシヘッドです。<br>3列植毛、ブラシヘッドが小さくコンパクトで隅々までブラッシングしやすいブラシヘッドです。<br>ブラシの毛先がひらいてきたら、新しいブラシにお取り替えください。ふつうブラシ。2本入。本体は別売りです。<br>*色を指定することはできませんのであらかじめご了承ください。*色はお選びいただけません。 交換方法1.片方の手で柄を握り、もう一方の手でブラシヘッドを握り、水平にやや強く引くとはずれます。2.新しいブラシヘッドは、カチッと音がなるまでしっかりと差し込んでください。 <br>ご注意：しっかり差し込んでも簡単にはずれる場合は、本体(柄)側の嵌合部が摩耗している恐れがありますので、本体を新しくしてください。 <br><br>品質表示：<br>●ヘッドの材質：ABS樹脂●毛の材質：ナイロン●毛のかたさ：ふつう●耐熱温度：80度  <br><br>販売_製造元： フクバデンタル<br>ブランド：キスユー<br>JAN：4969542130520<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
